import React from 'react';
import {Carousel} from 'react-bootstrap';
import hs1o from '../../Assets/hs1o.jpg';
import second from '../../Assets/hs2.jpg';
import third from '../../Assets/hs3.jpg';
import sd from '../../Assets/1sto.png';

export default class Corousel extends React.Component {

  render() {
    return (
      <div>
      <Carousel indicators={false} controls={false} interval={5000}>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={sd}
          alt="First slide"
        />
        <Carousel.Caption>
          <h1>Move to Canada</h1>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={second}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={third}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
    </div>
    );
  }
}
